window.bookSummaryJSON = "<p><b>“Carson joins the ranks of writers like Kristin Cashore, Megan Whalen Turner, and Tamora Pierce as one of YA’s best writers of high fantasy.” (</b><b><i>Locus </i></b><b>Magazine)&nbsp;</b></p> <p>The second book in Rae Carson’s award-winning and <i>New York Times </i>best-selling trilogy! Betrayal, love, and untold power fuel the heroic adventure of a 17-year-old princess turned warrior-queen. Fans of Tomi Adeyemi, Kendare Blake and Sarah J. Maas will be riveted.&nbsp;</p> <p>She does not know what awaits her at the enemy’s gate.&nbsp;</p> <p>Elisa led her people to victory over a terrifying, sorcerous army. Her place as queen should be secure. But it isn’t. Her enemies come at her like ghosts in a dream, from foreign realms and even from within her own court. And her destiny as the chosen one remains uncertain. To conquer the power she bears, Elisa must journey from the hidden catacombs beneath her own city to treacherous seas and a long-forgotten island. With her go a one-eyed spy, a traitor, and the man with whom - despite everything - she is falling in love. If she’s lucky, she’ll return. But there will be a cost.&nbsp;</p> <p>Don’t miss <i>The Empire of Dreams</i>, Rae Carson’s action-packed return to the world of <i>The Girl of Fire and Thorns</i>! &nbsp;</p>"; 
